import React from "react";
import NextLink from "next/link";
import { Box, Flex } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<{}> = () => {
  return (
    <Box
      p={"absolute"}
      w={"100vw"}
      h={"80px"}
      backgroundColor={"#333"}
      display={"flex"}
    >
      {/* <InnerBar> */}
      <Box style={{ cursor: "pointer", color: "#fff" }} m="auto">
        <NextLink href="/">LOGO</NextLink>
      </Box>
      <Box display="flex" justifyContent="space-evenly" margin="auto">
        <Box style={{ color: "#fff" }} m="auto" mr="10%">
          <NextLink href="/catagories">CATAGORIES</NextLink>
        </Box>
        <Box style={{ color: "#fff" }} m="auto" mr="10%">
          <NextLink href="/Box">ABOUT</NextLink>
        </Box>
        <Box m="auto">
          <input
            placeholder="🔍"
            style={{
              outline: "none",
              width: "7vw",
              textIndent: "5px",
              height: "30px",
              fontSize: "15px",
            }}
          ></input>
        </Box>
      </Box>
    </Box>
  );
};

export default NavBar;
